INSERT INTO `default_exercises` VALUES (3,0,'cable-chest-pre','cable chest press','Adjust the weight to an appropriate amount and be seated, grasping the handles. Your upper arms should be about 45 degrees to the body, with your head and chest up. The elbows should be bent to about 90 degrees. This will be your starting position.','d_2a808d4c57eb28972deb39e96f63765b.jpg','2014-12-19 05:22:06'),(4,0,'bench-press','Bench Press','Begin by lying on the bench, getting your head beyond the bar if possible. Tuck your feet underneath you and arch your back. Using the bar to help support your weight, lift your shoulder off the bench and retract them, squeezing the shoulder blades together. Use your feet to drive your traps into the bench. Maintain this tight body position throughout the movement.','d_35d43a8291d55003b6f847d0ef734188.jpg','2014-12-19 05:22:27'),(5,0,'alternate-hamme','Alternate Hammer Curl','Stand up with your torso upright and a dumbbell in each hand being held at arms length. The elbows should be close to the torso.','d_73557444727b8cae7185a7d24b38ea47.png','2014-12-19 05:22:56'),(6,0,'drag-curl','Drag Curl','Grab a barbell with a supinated grip (palms facing forward) and get your elbows close to your torso and back. This will be your starting position.','d_83d8928ee4fcbd139abc1bca37280b0b.jpg','2014-12-19 05:23:15'),(11,4,'system-exercise','System exercise 1','This is system exercise.','d_0236bdd40e8f0c595896f42dc695c8e9.jpg','2015-02-17 15:44:19'),(21,4,'dumbell-rows','Dumbell Rows','Warm up with light weight and use a bench for stability. ','d_575c4238c4371e5f5597bbb0b8429b85.jpg','2015-02-20 06:22:13'),(31,4,'t-bar-rows','T-Bar Rows','Bend your ass over. Warm up with a 25.','d_7adeacc8e3bf8e8743bf446ec3752568.jpg','2015-02-20 06:22:40'),(41,4,'lat-pull-downs','Lat Pull Downs','Use a wide grip. I\'m not at the gym so I don\'t know what weights are on the stack. Just do what\'s comfortable for the reps and adjust the weight on here to what you did. ','g_a59627f0824358c6f64baae886a1e267.jpg','2015-02-20 06:23:19'),(51,4,'hammer-strength','Hammer Strength High Rows','Use the high row hammer strength machine. I\'m not at the gym so I don\'t know what weights are on the stack. Just do what\'s comfortable for the reps and adjust the weight on here to what you did. ','d_c7d812de67d5586e69e9862533e7ee9d.jpg','2015-02-20 06:23:53'),(61,4,'barbell-rows','Barbell Rows','Use barbell','','2015-03-03 17:45:36'),(71,4,'lat-pulldowns','Lat Pulldowns','use wide grip','','2015-03-03 17:48:52'),(81,4,'back-row-machin','Back Row Machine','The one by the pull up machine. ','','2015-03-03 17:49:30'),(91,4,'rope-pulls','Rope Pulls','Target your mid traps','','2015-03-03 17:50:09'),(101,4,'barbell-bench-p','Barbell Bench Press','Lay flat on the bench. ','','2015-03-09 16:52:26'),(111,4,'incline-dumbbel','Incline Dumbbell Press','Warm up. ','','2015-03-09 16:52:45'),(121,4,'flat-dumbbell-f','Flat Dumbbell Flies','Warm up.','','2015-03-09 16:53:03'),(131,4,'cable-flies','Cable Flies','Use cables. ','','2015-03-09 16:53:17'),(141,4,'dumbbell-pullov','Dumbbell Pullovers ','Use one dumbbell on a flat bench and pull over your head. ','','2015-03-09 16:54:46'),(151,41,'flat-bench','Flat Bench','Grip pinkies around rings of bar, keep elbows in, and come close but do not touch chest.','d_45783bce90d0f77c6301b89c32fa891e.jpg','2015-04-03 16:42:43'),(161,41,'incline-bench','Incline Bench','Grip pinkies around the rings of the bar, keep elbows in, and come down to chin.','d_f952d88d608aee049b648d893f3595f4.png','2015-04-03 16:44:37'),(171,41,'flat-bench-dumb','Flat Bench Dumbbell Flies','Make sure to get a good stretch and flex/hold at the top.','d_a5873245614867c5a610e3acb02b699c.jpg','2015-04-03 16:47:11'),(181,41,'downward-cable-','Downward Cable Fly','Set cables at the top and when you bring your arms together make sure to flex/hold.','d_8d2524f615c328081f44e27eafa0c481.jpg','2015-04-03 16:50:43'),(191,41,'upward-cable-fl','Upward Cable Fly','Set cables to the bottom and remember to keep arms straight when you come up.','d_555d39a7ce9a375673fcf7fd2e0e8330.jpg','2015-04-03 16:52:58'),(201,41,'regular-cable-f','Regular Cable Flies','Set cables around shoulder height. Remember to flex/hold at the end.','d_afc3ea31adfe4a825eb545c24d665f23.jpg','2015-04-03 16:56:10'),(211,151,'squat-specturm','Squat Specturm','Hold a 90 Degree Air Squat for the time stated\nThan perform x slow frog squats to the floor\nThan perform x fast frog squats to the floor\nThan perform x frog squat to verticals as high as you can jump\n\nHow to read code:  SS: 30s-6-6-4 would be 30s squat hold, 6 slow squats, 6 fast squats, 4 squat verticals.','','2015-04-04 20:52:07'),(221,41,'bike','Bike','sdf','','2015-04-07 01:46:30'),(231,41,'dumbbell-should','Dumbbell Shoulder Press','Sit at 90 degree position and make sure to not bring your elbows below 90 degrees','','2015-04-15 17:14:07'),(241,41,'dumbbell-latera','Dumbbell Lateral Raises ','Stand up straight and bring parallel to ground','','2015-04-15 17:14:45'),(251,41,'front-raises-','Front Raises ','Stand up straight and bring ups up in front of you so til they are shoulder height','','2015-04-15 17:15:28'),(261,41,'shoulder-press-','Shoulder press machine','Sit on the machine and make sure to not bring elbows below 90 degrees','','2015-04-15 17:16:07'),(271,41,'dumbbell-shrugs','Dumbbell Shrugs','Stand up straight and keep arms straight. Bring shoulders up','','2015-04-15 17:16:58'),(281,41,'cable-upright-r','Cable Upright Rows','Set cable to lowest link and stand straight while leaning slight backwards and pulling the bar up to your chin','','2015-04-15 17:17:52'),(291,41,'squats','Squats','Legs shoulder width a apart. Go down 90 degress.','','2015-05-09 20:08:50'),(301,41,'calf-raises-','Calf Raises ','Balls of feet on platform and raise your feet.','','2015-05-15 22:14:18'),(311,4,'matt-test-matt','Matt Test Matt','test','','2015-05-28 16:49:47'),(321,111,'flat-barbell-be','Flat Barbell Bench','Arms shoulder width apart.\nGo down until elbows are perpendicular.\nKeep back flat along bench.','g_831d10b8d5754196e32aa2463de2a86a.jpg','2015-06-30 20:09:53'),(331,111,'reverse-hack-sq','Reverse Hack Squat','Make sure knees never go in front of toes.','','2015-06-30 22:34:45'),(341,111,'lunge','Lunge','No weights.\nToes in front of knees.','g_b8db72bd4a67d237b091bfa88512afba.jpg','2015-06-30 22:35:21'),(351,111,'weighted-lunge','Weighted Lunge','W/ barbell.\n','g_d9c3ca6bd0dfa9a35fc8d0e0713e0864.jpg','2015-06-30 22:36:54'),(361,111,'standing-mach-c','Standing Mach Calf Raises','Can vary stance.','','2015-06-30 22:37:54'),(371,111,'calf-extension-','Calf Extension ','Vary width.','g_0518f03e8a1dfc79e5ed0bc6fbc719de.jpg','2015-06-30 22:39:05'),(381,111,'squat','Squat','Toes in front of knees.','g_9b8ca46321170708ab4c90eea4a49a55.jpg','2015-06-30 22:41:19'),(391,111,'leg-curl','Leg Curl','Keep bar by ankles.','g_97d7cdcf2953597dbc23126bc1669cbd.jpg','2015-06-30 22:43:59'),(401,111,'leg-extension','Leg Extension','Keep bar by ankles.','g_9347e5e6627cc7518fa6e5b4be054630.jpg','2015-06-30 22:44:56'),(411,41,'curl-ups','Curl-Ups','Arms folded across the chest and your feet will held to the floor. You will curl-up touching elbows to thighs and will then lie back touching shoulder blades to deck.','d_d3675e8695d15e14b6ec3139530eccd7.jpg','2015-08-11 12:51:34'),(421,41,'push-ups','Push-Ups','1: Start in the rest position. Assume the front leaning position with hands approximately shoulder width apart and feet together. The arms, back, buttocks and legs must be straight from head to heels and must remain so throughout the push-up. 2: Begin the push-up by bending the elbow and lowering the entire body until the top of the\nupper arms are parallel to the deck and the elbows are bent at a 90 degree angle. Remember to keep the arms, back, buttocks, and legs aligned throughout the push-up motion. 3: Return to the starting position by extending the elbows until the arms are almost straight. Do not lock your elbows.','g_b2fe7d0bcf3c3c42b3ada8437c4a6364.jpg','2015-08-11 12:54:19'),(431,41,'incline-sit-ups','Incline Sit-Ups','Sit on the incline bench with knees over the top bar and feet under the lower bar to keep your body in position. Fold your arms across your chest, lean back so your back is flat on bench, and then sit up until your elbow are touching your knees. Repeat.','g_64ae74f43be1c350d37786f7d51e4b3f.jpg','2015-08-11 12:58:58'),(441,41,'elliptical','Elliptical','Grab the handle with one arm, step onto the machine by placing your feet onto the footsteps, hold onto the other handle with your other arm, and then start moving in a forward motion. Adjust resistance accordingly. Weight is resistance. ','g_e9da7bad738abd06e5281b0a2b4b3e23.jpg','2015-08-11 13:02:05'),(451,41,'running','Running','Remember it is important to make to sure to stretch and warm up before beginning. Reps is distance.','d_4d265f9efa16b5ceac8df8b30f86a6d6.jpg','2015-08-11 13:07:00'),(461,41,'squats-1','Squats','Keep your back straight and go down 90 degress','','2015-10-08 18:59:42'),(471,4,'neil-koby','Neil Koby','Chest','','2016-02-23 23:03:45');
