rtebrae at a time.','','','5408aad7556971409854167.jpg',1,'2014-09-04 13:09:27','0000-00-00 00:00:00','token175','1415717497'),(176,'',0,21,0,'Downward Facing Dog','Begin standing at the top of your yoga mat. Stretch your arms to the sky, the swan dive down, folding your body in half and placing your hands on the ground. Step your feet back and position your body into a plank. Lower your body to the ground, the push your hips into the air so that your body is folded into an 80 degree angle. Hold for 5 breaths, then step your feet forward between your hands, raise your hands to the sky with a deep breath. Lower arms, repeat. ','','','5408aca41a1c21409854628.jpg',1,'2014-09-04 13:17:08','2015-03-27 19:18:49','token176','1427485744'),(177,'',0,22,0,'Abdominal Hold','Sit tall on the edge of a sturdy chair (or step with four risers) and place your hands on the edge with your fingers pointing toward your knees. Tighten your abs and bring your toes 2 to 4 inches off the floor. Lift your butt off the chair. Hold this position for as long as you can -- aim for 5 to 10 seconds. Lower yourself down and repeat. Continue this exercise for 1 minute.','','','5419ce9285a341410977426.jpg',0,'2014-09-17 13:43:22','0000-00-00 00:00:00','token177','1415717497'),(178,'',0,22,0,'The Side Crunch','Kneel on the floor and lean all the way over to your right side, placing your right palm on the floor. Keeping your weight balanced, slowly extend your left leg and point your toes. Place your left hand behind your head, pointing your elbow toward the ceiling. Next, slowly lift your leg to hip height as you extend your arm above your leg, with your palm facing forward. Look out over your hand while bringing the left side of your rib cage toward your hip. Lower to your starting position and repeat 6 to 8 times. Do two sets of 6 to 8 reps, and then switch sides.','','','5419ce928cbd51410977426.jpg',0,'2014-09-17 13:43:22','0000-00-00 00:00:00','token178','1415717497'),(179,'',0,22,0,'Dead Lift','Stand above the bar with your feet a little less than shoulder width apart. They should be just inside your arms when you go down to reach for the bar. Position your feet under the bar so that when looking down the bar is directly over the center of your feet. Grab the bar with you arms perpendicular to the floor. Bend down through your knees until your shins make contact with the bar. To prepare for your lift, lift your chest up and pull your shoulders back. Now pull up lifting the bar while keeping it as close to your body as possible. Keep your back straight through the entire movement. As you bring the bar past your knees thrust your hips forward while you straighten out your legs and form a straight line throughout your hips, knees and feet. Return to starting position.','','','5419ce928df531410977426.jpg',0,'2014-09-17 13:43:22','0000-00-00 00:00:00','token179','1415717497'),(180,'',0,22,0,'Squat','Position the bar in a comfortable position on your trap muscles. This may be uncomfortable at first but you will become accustomed to it as time goes on. Keep your head up, hips and shoulders back, weight on the heels, and knees inline with your feet. Squat down, keeping the posture outlined in step 3, down to your preferred level. Many people say it is best to go 90 degrees, some like to go all the way down until their ass hits their ankles. This is a debate for another article. Make sure that your knees never go beyond your toes. This puts terrible, damaging strain on your ligaments. Push up through your heels on the ground and raise the bar back to starting position while keeping your back straight, head up and shoulders back.','','','5419ce92933941410977426.jpg',0,'2014-09-17 13:43:22','0000-00-00 00:00:00','token180','1415717497'),(181,'Great workout ',0,23,0,'Bench Press','Grab the bar with a slightly outside shoulder grip. Your hips should be firmly placed on the bench with a slight arch on your lower back. Your feet should be planted flat on the ground. Your shoulders should be locked downwards with your shoulder blades squeezed together. Lower the bar to your sternum area keeping your elbows at a 45 degree angle. Drive the bar up keeping your body and legs tight.','00:37','','5419d0fe2416e1410978046.jpg',1,'2014-09-17 13:20:46','0000-00-00 00:00:00','token181','1415717497'),(182,'',0,23,0,'Pull Up','There are a few different ways to do pull-ups, each as beneficial as the last, which we will go over in an in depth pullup article later: You can have palms facing forward, You can have palms facing backward, You can do close grip, You can go wide grip. The most traditional pull-up, is with palms facing forward with a wide grip, slightly wider than your shoulders. Simply hang with this grip and pull your body straight up until your chin is over the bar. Hold here for a second and then slowly lower your body back to free hang position.','00:03','','5419d0fe29a2e1410978046.jpg',1,'2014-09-17 13:20:46','0000-00-00 00:00:00','token182','1415717497'),(183,'',0,23,0,'Military Press','Start by positioning yourself under a barbell that is at chest height on a squat rack. Grab the barbell with your palms forward, slightly wider than shoulder width apart. With your feet shoulder width apart and the bar resting on your collar bone, slightly bend at the knees and explode up, lifting the bar over head by locking your arms.  Lower the bar back down the starting position as you exhale','00:17','','5419d0fe2af911410978046.jpg',1,'2014-09-17 13:20:46','0000-00-00 00:00:00','token183','1415717497'),(184,'',0,23,0,'Deadlift','Stand above the bar with your feet a little less than shoulder width apart. They should be just inside your arms when you go down to reach for the bar. Position your feet under the bar so that when looking down the bar is directly over the center of your feet. Grab the bar with you arms perpendicular to the floor. Bend down through your knees until your shins make contact with the bar. To prepare for your lift, lift your chest up and pull your shoulders back. Now pull up lifting the bar while keeping it as close to your body as possible. Keep your back straight through the entire movement. As you bring the bar past your knees thrust your hips forward while you straighten out your legs and form a straight line throughout your hips, knees and feet. Return to starting position.','01:32','','5419d0fe2eac01410978046.jpg',1,'2014-09-17 13:20:46','0000-00-00 00:00:00','token184','1415717497'),(185,'',0,24,0,'Bench Press','Grab the bar with a slightly outside shoulder grip. Your hips should be firmly placed on the bench with a slight arch on your lower back. Your feet should be planted flat on the ground. Your shoulders should be locked downwards with your shoulder blades squeezed together. Lower the bar to your sternum area keeping your elbows at a 45 degree angle. Drive the bar up keeping your body and legs tight.','','','5419d1d471f361410978260.jpg',1,'2014-09-17 13:24:20','2015-03-27 19:19:34','token185','1427483974'),(186,'',0,24,0,'Abdominal Hold','Sit tall on the edge of a sturdy chair (or step with four risers) and place your hands on the edge with your fingers pointing toward your knees. Tighten your abs and bring your toes 2 to 4 inches off the floor. Lift your butt off the chair. Hold this position for as long as you can -- aim for 5 to 10 seconds. Lower yourself down and repeat. Continue this exercise for 1 minute.','','','5419d1d47d9b71410978260.jpg',0,'2014-09-17 13:24:20','2015-03-27 19:19:34','token186','1427483974'),(187,'',0,24,0,'Pull Up','There are a few different ways to do pull-ups, each as beneficial as the last, which we will go over in an in depth pullup article later: You can have palms facing forward, You can have palms facing backward, You can do close grip, You can go wide grip. The most traditional pull-up, is with palms facing forward with a wide grip, slightly wider than your shoulders. Simply hang with this grip and pull your body straight up until your chin is over the bar. Hold here for a second and then slowly lower your body back to free hang position.','','','5419d1d4800261410978260.jpg',0,'2014-09-17 13:24:20','2015-03-27 19:19:34','token187','1427483974'),(188,'',0,24,0,'Squat','Position the bar in a comfortable position on your trap muscles. This may be uncomfortable at first but you will become accustomed to it as time goes on. Keep your head up, hips and shoulders back, weight on the heels, and knees inline with your feet. Squat down, keeping the posture outlined in step 3, down to your preferred level. Many people say it is best to go 90 degrees, some like to go all the way down until their ass hits their ankles. This is a debate for another article. Make sure that your knees never go beyond your toes. This puts terrible, damaging strain on your ligaments. Push up through your heels on the ground and raise the bar back to starting position while keeping your back straight, head up and shoulders back.','','','5419d1d48300c1410978260.jpg',0,'2014-09-17 13:24:20','2015-03-27 19:19:34','token188','1427483974'),(189,'',0,25,0,'Bench Press','Grab the bar with a slightly outside shoulder grip. Your hips should be firmly placed on the bench with a slight arch on your lower back. Your feet should be planted flat on the ground. Your shoulders should be locked downwards with your shoulder blades squeezed together. Lower the bar to your sternum area keeping your elbows at a 45 degree angle. Drive the bar up keeping your body and legs tight.','','','5419d2fe306001410978558.jpg',0,'2014-09-17 13:29:18','0000-00-00 00:00:00','token189','1415717498'),(190,'',0,25,0,'Pull-Up','There are a few different ways to do pull-ups, each as beneficial as the last, which we will go over in an in depth pullup article later: You can have palms facing forward, You can have palms facing backward, You can do close grip, You can go wide grip. The most traditional pull-up, is with palms facing forward with a wide grip, slightly wider than yo