e vertebrae at a time.','','','5419d56faa4971410979183.jpg',1,'2014-09-17 13:39:43','0000-00-00 00:00:00','token201','1415717498'),(202,'',0,28,0,'Bench Press','Grab the bar with a slightly outside shoulder grip. Your hips should be firmly placed on the bench with a slight arch on your lower back. Your feet should be planted flat on the ground. Your shoulders should be locked downwards with your shoulder blades squeezed together. Lower the bar to your sternum area keeping your elbows at a 45 degree angle. Drive the bar up keeping your body and legs tight.','','','5419d6c39633f1410979523.jpg',1,'2014-09-26 08:20:32','0000-00-00 00:00:00','token202','1415717498'),(203,'',0,28,0,'Abdominal Hold','Sit tall on the edge of a sturdy chair (or step with four risers) and place your hands on the edge with your fingers pointing toward your knees. Tighten your abs and bring your toes 2 to 4 inches off the floor. Lift your butt off the chair. Hold this position for as long as you can -- aim for 5 to 10 seconds. Lower yourself down and repeat. Continue this exercise for 1 minute.','','','5419d6c39cbcc1410979523.jpg',1,'2014-09-26 08:20:32','0000-00-00 00:00:00','token203','1415717498'),(204,'',0,28,0,'Squat','Position the bar in a comfortable position on your trap muscles. This may be uncomfortable at first but you will become accustomed to it as time goes on. Keep your head up, hips and shoulders back, weight on the heels, and knees inline with your feet. Squat down, keeping the posture outlined in step 3, down to your preferred level. Many people say it is best to go 90 degrees, some like to go all the way down until their ass hits their ankles. This is a debate for another article. Make sure that your knees never go beyond your toes. This puts terrible, damaging strain on your ligaments. Push up through your heels on the ground and raise the bar back to starting position while keeping your back straight, head up and shoulders back.','','','5419d6c39ff831410979523.jpg',1,'2014-